<div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAKsAAAACCAIAAACombtoAAAACXBIWXMAABYlAAAWJQFJUiTwAAAAFklEQVQ4y2NkTT7IMApGMGAaDYIRDgCx3gEtGlWO+AAAAABJRU5ErkJggg=="/><div class="c x1 y1 w2 h0"><div class="t m0 x0 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0">Datenschutz<span class="_ _0"></span>hinweise </div><div class="t m0 x0 h3 y3 ff1 fs1 fc0 sc0 ls0 ws0">Mit diesen Hinweisen infor<span class="_ _1"></span>mieren wir dich über die V<span class="_ _1"></span>erarbeitung d<span class="_ _1"></span>einer personenbezogenen Da<span class="_ _1"></span>ten durch die </div><div class="t m0 x0 h3 y4 ff1 fs1 fc0 sc0 ls0 ws0">Skolio App un<span class="_ _1"></span>d die dir nach dem Datenschutzrecht <span class="_ _1"></span>zustehen<span class="_ _1"></span>den Rechte. <span class="_ _1"></span> </div><div class="t m0 x0 h3 y5 ff1 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h3 y6 ff1 fs1 fc0 sc0 ls0 ws0">Verantwortliche Stelle im <span class="_ _1"></span>Sinne der Datenschutz<span class="_ _1"></span>gesetze, in<span class="_ _1"></span>sbesondere der EU<span class="_ _1"></span>-Datenschut<span class="_ _1"></span>zgrundverordnung </div><div class="t m0 x0 h3 y7 ff1 fs1 fc0 sc0 ls0 ws0">(DSGVO), ist: </div><div class="t m0 x0 h3 y8 ff1 fs1 fc0 sc0 ls0 ws0">Skolio App </div><div class="t m0 x0 h3 y9 ff1 fs1 fc0 sc0 ls0 ws0">Florian Zenk </div><div class="t m0 x0 h3 ya ff1 fs1 fc0 sc0 ls0 ws0">Markgrafenstr. 12<span class="_ _1"></span> </div><div class="t m0 x0 h3 yb ff1 fs1 fc0 sc0 ls0 ws0">90459 Nürnberg<span class="_ _1"></span> </div><div class="t m0 x0 h4 yc ff2 fs1 fc1 sc0 ls0 ws0">info@skolio-app.d<span class="_ _1"></span>e<span class="ff1 fc0"> </span></div><div class="t m0 x0 h5 yd ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h5 ye ff1 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h2 yf ff1 fs0 fc0 sc0 ls0 ws0">Deine Betroffen<span class="_ _0"></span>enrechte </div><div class="t m0 x0 h3 y10 ff1 fs1 fc0 sc0 ls0 ws0">Du kannst un<span class="_ _1"></span>ter der E-Mail-Adresse in<span class="_ _1"></span>fo@skolio-app<span class="_ _1"></span>.de über die zu d<span class="_ _1"></span>einer Person gespeicherten Da<span class="_ _1"></span>ten </div><div class="t m0 x0 h3 y11 ff1 fs1 fc0 sc0 ls0 ws0">verlangen. Darüber hinau<span class="_ _1"></span>s kannst du u<span class="_ _1"></span>nter bestimmten Voraussetzungen d<span class="_ _1"></span>ie Berichtigung oder d<span class="_ _1"></span>ie Löschung </div><div class="t m0 x0 h3 y12 ff1 fs1 fc0 sc0 ls0 ws0">deiner Daten verlangen. Di<span class="_ _1"></span>r kann weiterhin ein Rech<span class="_ _1"></span>t auf Einschränku<span class="_ _1"></span>ng der Verarbeitung deiner Daten so<span class="_ _2"></span>wie </div><div class="t m0 x0 h3 y13 ff1 fs1 fc0 sc0 ls0 ws0">ein Recht auf Herausgab<span class="_ _1"></span>e der von dir bereitg<span class="_ _1"></span>estellten Daten in einem struktu<span class="_ _1"></span>rierten, gängigen un<span class="_ _1"></span>d </div><div class="t m0 x0 h3 y14 ff1 fs1 fc0 sc0 ls0 ws0">maschinenlesbaren Format z<span class="_ _1"></span>ustehen.<span class="_ _1"></span> </div><div class="t m0 x0 h3 y15 ff1 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h2 y16 ff1 fs0 fc0 sc0 ls0 ws0">Beschwerderech<span class="_ _0"></span>t </div><div class="t m0 x0 h3 y17 ff1 fs1 fc0 sc0 ls0 ws0">Du hast die Möglichkeit, d<span class="_ _1"></span>ich mit einer Be<span class="_ _1"></span>schwerde an den o. g. Da<span class="_ _1"></span>tenschutzbeauftragten<span class="_ _1"></span> oder an eine </div><div class="t m0 x0 h3 y18 ff1 fs1 fc0 sc0 ls0 ws0">Datenschutzaufsichtsbehörd<span class="_ _1"></span>e zu wenden. Die für un<span class="_ _1"></span>s zuständige Datenschutz<span class="_ _1"></span>aufsichtsbehörd<span class="_ _1"></span>e ist:<span class="_ _1"></span> </div><div class="t m0 x0 h3 y19 ff1 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h3 y1a ff1 fs1 fc0 sc0 ls0 ws0">Bayerisches Landesamt für Da<span class="_ _1"></span>tenschutzaufsich<span class="_ _1"></span>t </div><div class="t m0 x0 h3 y1b ff1 fs1 fc0 sc0 ls0 ws0">Promenade 18, 91522 An<span class="_ _1"></span>sbach<span class="_ _1"></span> </div><div class="t m0 x0 h3 y1c ff1 fs1 fc0 sc0 ls0 ws0">Postanschrift: Postfach<span class="_ _1"></span> 606, 91511 Ansbach<span class="_ _1"></span> </div><div class="t m0 x0 h3 y1d ff1 fs1 fc0 sc0 ls0 ws0">Telefon: 0981/180093<span class="_ _1"></span>-0 </div><div class="t m0 x0 h3 y1e ff1 fs1 fc0 sc0 ls0 ws0">Telefax: 0981/180093-<span class="_ _1"></span><span class="ls1">99</span> </div><div class="t m0 x0 h3 y1f ff1 fs1 fc0 sc0 ls0 ws0">E-Mail: poststelle@lda.bay<span class="_ _1"></span>ern.de<span class="_ _1"></span> </div><div class="t m0 x0 h3 y20 ff1 fs1 fc0 sc0 ls0 ws0">Homepage: http<span class="_ _1"></span>s://Ida.bayern.de<span class="_ _1"></span> </div><div class="t m0 x0 h3 y21 ff1 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h2 y22 ff1 fs0 fc0 sc0 ls0 ws0">Widerspruchsrec<span class="_ _0"></span>ht </div><div class="t m0 x0 h3 y23 ff1 fs1 fc0 sc0 ls0 ws0">Du hast das Recht, einer V<span class="_ _1"></span>erarbeitung d<span class="_ _1"></span>einer personenbez<span class="_ _1"></span>ogenen Daten zu widersprec<span class="_ _1"></span>h<span class="_ _1"></span>en. Verarbeiten wir </div><div class="t m0 x0 h3 y24 ff1 fs1 fc0 sc0 ls0 ws0">deine Daten zur Wahru<span class="_ _1"></span>ng berechtigter Interessen, kan<span class="_ _1"></span>nst du dieser Verarbeitun<span class="_ _1"></span>g widersprechen, wenn s<span class="_ _1"></span>ich </div><div class="t m0 x0 h3 y25 ff1 fs1 fc0 sc0 ls0 ws0">aus deiner besonderen Situat<span class="_ _1"></span>ion Gründ<span class="_ _1"></span>e ergeben, die gegen die Datenverarb<span class="_ _1"></span>eitung sprechen.<span class="_ _2"></span> </div><div class="t m0 x0 h6 y26 ff1 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h2 y27 ff1 fs0 fc0 sc0 ls0 ws0">Recht auf Date<span class="_ _0"></span>nübertragbarkeit<span class="_ _0"></span> </div><div class="t m0 x0 h3 y28 ff1 fs1 fc0 sc0 ls0 ws0">Dir steht das Recht zu<span class="_ _1"></span>, Daten, die wir auf Grund<span class="_ _1"></span>lage deiner E<span class="_ _1"></span>inwilligung oder in Erfüllun<span class="_ _1"></span>g eines Vertrags </div><div class="t m0 x0 h3 y29 ff1 fs1 fc0 sc0 ls0 ws0">automatisiert verarbeiten, a<span class="_ _1"></span>n dich oder an<span class="_ _1"></span> Dritte aushändigen zu la<span class="_ _1"></span>ssen. Die Bereitstellung erfolgt in<span class="_ _1"></span> einem </div><div class="t m0 x0 h3 y2a ff1 fs1 fc0 sc0 ls0 ws0">maschinenlesbaren Format. <span class="_ _1"></span>Sofern du die d<span class="_ _1"></span>irekte Übertra<span class="_ _1"></span>gung der Dat<span class="_ _1"></span>en an einen anderen Verantwort<span class="_ _1"></span>lichen </div><div class="t m0 x0 h3 y2b ff1 fs1 fc0 sc0 ls0 ws0">verlangst, erfolgt dies nur, so<span class="_ _1"></span>weit es technisch machb<span class="_ _1"></span>ar ist.<span class="_ _1"></span> </div><div class="t m0 x0 h6 y2c ff1 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x0 h2 y2d ff1 fs0 fc0 sc0 ls0 ws0">Zwecke der <span class="_ _0"></span>Datenverarbeitun<span class="_ _0"></span>g durch die <span class="_ _0"></span>verantwortliche Stelle <span class="_ _0"></span>und Dritte  </div><div class="t m0 x0 h3 y2e ff1 fs1 fc0 sc0 ls0 ws0">Die Betreiber dieser App n<span class="_ _1"></span>ehmen den Schutz d<span class="_ _1"></span>einer persönlichen Da<span class="_ _3"></span>ten sehr ernst. Wir <span class="_ _1"></span>behandeln deine </div><div class="t m0 x0 h3 y2f ff1 fs1 fc0 sc0 ls0 ws0">personenbezogenen Daten v<span class="_ _1"></span>ertraulich un<span class="_ _1"></span>d entsprechend der gesetzlich<span class="_ _1"></span>en Datenschutzv<span class="_ _1"></span>orschriften sowie </div><div 